ggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('en','messages:ooui-outline-control-move-down','s:14:\"Move item down\";'),('en','messages:ooui-outline-control-move-up','s:12:\"Move item up\";'),('en','messages:ooui-outline-control-remove','s:11:\"Remove item\";'),('en','messages:ooui-toolbar-more','s:4:\"More\";'),('en','messages:ooui-toolgroup-expand','s:4:\"More\";'),('en','messages:ooui-toolgroup-collapse','s:5:\"Fewer\";'),('en','messages:ooui-dialog-message-accept','s:2:\"OK\";'),('en','messages:ooui-dialog-message-reject','s:6:\"Cancel\";'),('en','messages:ooui-dialog-process-error','s:20:\"Something went wrong\";'),('en','messages:ooui-dialog-process-dismiss','s:7:\"Dismiss\";'),('en','messages:ooui-dialog-process-retry','s:9:\"Try again\";'),('en','messages:ooui-dialog-process-continue','s:8:\"Continue\";'),('en','messages:cologneblue.css','s:64:\"/* CSS placed here will affect users of the Cologne Blue skin */\";'),('en','messages:cologneblue.js','s:78:\"/* Any JavaScript here will be loaded for users using the Cologne Blue skin */\";'),('en','messages:skinname-cologneblue','s:12:\"Cologne Blue\";'),('en','messages:cologneblue-desc','s:42:\"A lightweight skin with minimal formatting\";'),('en','messages:modern.css','s:58:\"/* CSS placed here will affect users of the Modern skin */\";'),('en','messages:modern.js','s:72:\"/* Any JavaScript here will be loaded for users using the Modern skin */\";'),('en','messages:skinname-modern','s:6:\"Modern\";'),('en','messages:modern-desc','s:65:\"A blue/grey theme with sidebar and top bar. Derived from MonoBook\";'),('en','messages:skinname-monobook','s:8:\"MonoBook\";'),('en','messages:monobook-desc','s:109:\"The classic MediaWiki skin since 2004, named after the black-and-white photo of a book in the page background\";'),('en','messages:monobook.css','s:60:\"/* CSS placed here will affect users of the MonoBook skin */\";'),('en','messages:monobook.js','s:74:\"/* Any JavaScript here will be loaded for users using the MonoBook skin */\";'),('en','messages:skinname-vector','s:6:\"Vector\";'),('en','messages:vector-skin-desc','s:74:\"Modern version of MonoBook with fresh look and many usability improvements\";'),('en','messages:vector.css','s:58:\"/* CSS placed here will affect users of the Vector skin */\";'),('en','messages:vector.js','s:72:\"/* Any JavaScript here will be loaded for users using the Vector skin */\";'),('en','messages:vector-action-addsection','s:9:\"Add topic\";'),('en','messages:vector-action-delete','s:6:\"Delete\";'),('en','messages:vector-action-move','s:4:\"Move\";'),('en','messages:vector-action-protect','s:7:\"Protect\";'),('en','messages:vector-action-undelete','s:8:\"Undelete\";'),('en','messages:vector-action-unprotect','s:17:\"Change protection\";'),('en','messages:vector-view-create','s:6:\"Create\";'),('en','messages:vector-view-edit','s:4:\"Edit\";'),('en','messages:vector-view-history','s:12:\"View history\";'),('en','messages:vector-view-view','s:4:\"Read\";'),('en','messages:vector-view-viewsource','s:11:\"View source\";'),('en','messages:vector-more-actions','s:4:\"More\";'),('en','messages:spam-blacklist','s:512:\" #<!-- leave this line exactly as it is --> <pre>\n# External URLs matching this list will be blocked when added to a page.\n# This list affects only this wiki; refer also to the global blacklist.\n# For documentation see https://www.mediawiki.org/wiki/Extension:SpamBlacklist\n#\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:spam-whitelist','s:406:\" #<!-- leave this line exactly as it is --> <pre>\n# External URLs matching this list will *not* be blocked even if they would\n# have been blocked by blacklist entries.\n#\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:email-blacklist','s:538:\" #<!-- leave this line exactly as it is --> <pre>\n# Email addresses matching this list will be blocked from registering or sending emails\n# This list affects only this wiki; refer also to the global blacklist.\n# For documentation see https://www.mediawiki.org/wiki/Extension:SpamBlacklist\n#\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside email addresses\n\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:email-whitelist','s:419:\" #<!-- leave this line exactly as it is --> <pre>\n# Email addresses matching this list will *not* be blocked even if they would\n# have been blocked by blacklist entries.\n#\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside email addresses\n\n #</pre> <!-- leave this line exactly as it is -->\";'),('en','messages:spam-blacklisted-email','s:25:\"Blacklisted email address\";'),('en','messages:spam-blacklisted-email-text','s:79:\"Your email address is currently blacklisted from sending emails to other users.\";'),('en','messages:spam-blacklisted-email-signup','s:58:\"The given email address is currently blacklisted from use.\";'),('en','messages:spam-invalid-lines','s:185:\"The following spam blacklist {{PLURAL:$1|line is an|lines are}} invalid regular {{PLURAL:$1|expression|expressions}} and {{PLURAL:$1|needs|need}} to be corrected before saving the page:\";'),('en','messages:spam-blacklist-desc','s:103:\"Regex-based anti-spam tool allowing to blacklist URLs in pages and email addresse