INSERT INTO `searchindex` VALUES (1,'main page','  welcome tou800 helpiez wiki   welcome tou800 helpiez wiki   welcome tou800 helpiez wiki  weu800 welcome youu800 tou800 participate inu800 ouru800 collective effort. ouru800 project isu800 categorized into following vertical. verticals verticals verticals campaigning & awareness organization finance & operation features & design software & code policy & legal '),(2,'syntax',' fewu800 important syntax foru800 complete reference visit syntax '),(3,'sidebar',' navigation mainpage home page campaigning & awareness awareness software & code software & code features & design features & design recentchanges-urlu800 recentchanges randompage-urlu800 randompage start writing start writing search toolbox languages '),(4,'software & code','  welcome tou800 software section ofu800 helpiez wiki.  this section will discuss theu800 code andu800 software used foru800 developing helpiez website mobile application andu800 backend powering allu800 applications. this section isu800 dedicated foru800 code andu800 programming done foru800 helpiez related project. foru800 features & design oru800 website functionality please visit there respected section. subproject subproject subproject backend '),(5,'start writing',' fewu800 important links foru800 references syntax '),(6,'backend',' file networktopology-fullyconnectedu82epngu800 150px right while designing theu800 backend ofu800 helpiez au800 modular design approach isu800 used. theu800 backend isu800 separated from frontend. theu800 apis provided byu800 theu800 backend isu800 consumed byu800 theu800 website andu800 mobile apps. spring boot isu800 used with mysql database tou800 make theu800 restful apis. theu800 backend apis areu800 currently inu800 version 1u800 andu800 canu800 beu800 accessed using uriu800 data model data model data model theu800 tables areu800 asu800 follows users intu800 userid varchar email varchar name varchar password timestamp joined varchar urlu800 varchar profileimage usermeta intu800 usermetaid intu800 userid varchar usermetakey varchar usermetavalue post intu800 postid varchar name varchar type '),(8,'networktopology-fullyconnectedu82epngu800',' '),(9,'features & design',' user perspective nssu800 perspective nssu800 perspective nssu800 perspective nonu800-profit perspective companies schools colleges hospitals perspectives companies schools colleges hospitals perspectives companies schools colleges hospitals perspectives ');
